import { storeConstants } from 'library/common/constants';

const initialState = {
    vehicles: [],
};

const VehiclesReducer = (state = initialState, action) => {
    switch (action.type) {
        case storeConstants.FETCH_VEHICLES:
            return {
                ...state,
                vehicles: action.payload,
            };
        default:
            return state;
    }
};

export default VehiclesReducer;
